    sentence = ""
    subject = None
    for triple in triples:
        if subject is None:
            subject = triple.subject
            sentence += f"{subject} "
        if triple.predicate == "cityServed":
            sentence += f"serves the city of {triple.object} and "
            subject = triple.object # Track city for potential further connections
        elif triple.predicate == "country":
            sentence += f"is in {triple.object} and "
